import React from "react";
import NAvbsr from "./NAvbsr";
import photo from "./images/photo.png"

function Home() {
  return (
    <>
      <NAvbsr />
      <div className="row">
        <div className="col-lg-6 intro">
          My self
          <h1>PRITAM MULI</h1>
          <h5>Front-end React JS developer</h5>
        </div>
        <div className="col-lg-6 image_section_container">
          <img src={photo} className="image_section"></img>
        </div>
      </div>
    </>
  );
}

export default Home;
